import { createContext } from "react";
import type { Work } from "./useFetch";
import { Moment } from "moment";

export interface Details {
  name: string;
  age: Moment;
  city: string;
  email: string;
  github: string;
  linkedin: string;
  image: string[];
}

export interface Blog {
  title: string;
  date: Moment;
  content: string;
}

interface SomeContextValue {
  details?: Details;
  misc?: {
    bio: string;
    description: string[];
    important: string;
    skills: string[];
  };
  work?: Work[];
}

export const SomeContext = createContext<SomeContextValue | null>(null);
